import { Dialog, DialogContent, DialogActions, DialogContentText, DialogTitle } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles({
    root: {
        margin: "20px",

    },
    content: {
        borderRadius: "10px",
        textAlign: "center",
        color: "#000000",
        padding: "0px 7px 0 7px",
    },
    title: {
        fontWeight: 500,
        fontSize: "18px",
        marginBottom: 10,
        marginTop: 0,
    },
    text: {
        fontSize: "14px",
        lineHeight: "20px",
        fontWeight: 400,
        marginTop: 0,
    },
    button: {
        color: "#8D1CD4",
        borderTop: "1px solid #D2D2D2",
        justifyContent: "center",
        fontWeight: 500,
        fontSize: "14px",
        cursor: "pointer",
    },
});

export default function DetailDialog(props) {
    const { open, onClose, data } = props;
    const classes = useStyles();
    const renderDetail = () => {
        return users.map((user) => {
            const { avatar_url, login, site_admin } = user
            return (

                <List component="nav" className={classes.root}>
                    <ListItem style={{ height: 50 }}>
                        <ListItemAvatar><Avatar src={avatar_url} /></ListItemAvatar>
                        <ListItemText> {login}</ListItemText>
                        <ListItemText> {site_admin ? <StarsIcon /> : ""} </ListItemText>
                        <ListItemText style={{ textAlign: 'right' }}>
                            <Button variant="outlined" color="primary" onClick={handleClickOpen}>
                                Detail
                            </Button>
                            <DetailDialog open={open} close={handleClose} data={users} />
                        </ListItemText>

                    </ListItem>
                </List>
            )
        }
        )
    }
    return (

        <Dialog
            className={classes.root}
            onClose={onClose} aria-labelledby="simple-dialog-title" open={open}
        >
            <DialogTitle id="alert-dialog-title">User Information</DialogTitle>
            <DialogContent className={classes.content}>
                <DialogContentText id="alert-dialog-description">
                    {renderDetail()}
                    Google, even when no apps are running.
                </DialogContentText>
            </DialogContent>
            <DialogActions>

            </DialogActions>
        </Dialog>

    )
}
